import React, {Component} from 'react'
import {Link} from 'react-router-dom'

class Navbar extends Component{
    render(){
        setActivePath = (activePathName) => {
            if (activePathName == window.location.pathname){
                return "blue"
            }else{
                return "black"
            }
        }
        return(
            <div className="App">
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login <Link style={{textDecoration:"none", "color": setActivePath("/register")}} to="/register">Register</Link></h2>
                    <hr/> 
              
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}
const linkStyle = {
    textDecoration: "none",
    color: "black"
}

export default Navbar;
